"În timpul procesului de mutare: 
• nu scoateți ^1; 
• unele aplicații nu vor funcționa corect; 
• păstrați dispozitivul încărcat."

"Cu ajutorul fixării aplicației, puteți fixa aplicația actuală pentru a rămâne vizibilă până la anularea fixării. Această funcție poate fi folosită, de exemplu, pentru a-i permite unui prieten de încredere să joace un anumit joc. 

Atunci când o aplicație este fixată, aceasta poate deschide alte aplicații și pot fi accesate date cu caracter personal. 

Pentru a folosi fixarea aplicației: 
1. activați fixarea aplicației; 
2. deschideți Recente; 
3. atingeți pictograma aplicației din partea de sus a ecranului, apoi atingeți Fixați."
